	function servicesForm() {
		return (
			<BrowserRouter>
				<p>{restaurant}</p>
				<Routes>
					<Route path="/" element={<RestaurantsList />} />
					<Route path={"/showMenu/" + restaurant} element={<ShowMenu restaurant={restaurant} />} />
					<Route path={"/showMenuItem"} element={<ShowMenuItem menuItem={1} />} />
				</Routes>
			</BrowserRouter>
		);
	}
	return (
		<>
			<MenuContext.Provider value={[restaurant, setRestaurant]}>
				{servicesForm()}
			</MenuContext.Provider>
		</>
	);
}
export default App;
